// src/components/homepage.js
import React from 'react';
import { useNavigate } from 'react-router-dom';  // Import useNavigate hook
import '../styles/homepage.css';  // Link to the CSS file

const HomePage = () => {
  const navigate = useNavigate();  // Initialize the navigate function

  // Function to handle button click and navigate to the invoices page
  const handleStartManagement = () => {
    navigate('/invoices');  // Redirect to /invoices
  };

  return (
    <div className="home-page-container">
      <h1 className="home-page-header">Welcome to Invoice Management System</h1>
      <button className="home-page-button" onClick={handleStartManagement}>
        Start Management
      </button>
    </div>
  );
};

export default HomePage;
